import React from 'react';
import './App.css'

function Card() {
    return (
        <>
        <div className="container">
            <div className="image_container">

            </div>
            <div className="story_container">
                <strong style={{textAlign:"center"}}>Story</strong>
            </div>
        </div>
        </>
    )
}
export default Card;
